var BAIDUID = getBAIDUIdFromCookie(req);
if (BAIDUID) {
    var tmpData = JSON.parse(ral_option.data);
    tmpData['baiduid'] = BAIDUID;
    ral_option.data = JSON.stringify(tmpData);
}
else {
    log.debug('have no BAIDU');
}
